//  AppLayout -> 메뉴 
// Components => components 

import React from 'react';
import PropTypes from "prop-types";

const AppLayout = ({children}) => {
    return(
        <div>
            <div> 공통메뉴 </div>
            {children}
        </div>
    )
} ;


AppLayout.proptypes = { 
    children : PropTypes.node.isRequired,
}; 


export default AppLayout;
